import {Link} from 'react-router-dom'
im
let Nav = () =>{
    return(
        <nav className='nav'>
            <Link to = '/'>Home</Link>
            <Link to = '/result'>Results</Link>
            <Link to = '/add-results'>Store-Results</Link>
        </nav>
    )
}
export default Nav;
